this.traverse((child)=>{
	child.castShadow = true;
	child.receiveShadow = true;
	if (child.isMesh){
		shadow(child);
	}
});
console.log(this);
function shadow(child){
	var oldcolor = new THREE.Color();
	oldcolor = child.material.color;
	var newMaterial = new THREE.MeshPhysicalMaterial();
	newMaterial.color.set(oldcolor);
	child.material = newMaterial;
	console.log(child.material);
}

DD436DF9-7AE2-43C0-B8DE-B1057C80D3FB.source:
this.traverse((child)=>{
	child.castShadow = true;
	child.receiveShadow = true;
	if (child.isMesh){
		shadow(child);
	}
});
//console.log(this);
function shadow(child){
	var oldcolor = new THREE.Color(0xff0000);
	//oldcolor = child.material.color;
	var newMaterial = new THREE.MeshPhysicalMaterial();
	newMaterial.color.set(oldcolor);
	newMaterial.transparent = false;
	child.material = newMaterial;
}

